using System;
using System.Drawing;
using System.Drawing.Imaging;
using System.IO;
using SAPUtils.Forms;

namespace SAPUtils.Internal.Utils
{
    internal static class HitchIconClass
    {
        internal static readonly Stream HitchIcon = new MemoryStream(Convert.FromBase64String(HitchIconData));

        internal static string HitchIconPath
        {
            get
            {
                using (Icon icon = new Icon(HitchIcon))
                {
                    Bitmap bitmap = icon.ToBitmap();

                    Bitmap resizedBitmap = new Bitmap(20, 20);
                    using (Graphics graphics = Graphics.FromImage(resizedBitmap))
                    {
                        graphics.Clear(SapColors.SapTransparent);
                        graphics.DrawImage(bitmap, 0, 0, 20, 20);
                    }

                    for (int y = 0; y < resizedBitmap.Height; y++)
                    {
                        for (int x = 0; x < resizedBitmap.Width; x++)
                        {
                            Color pixelColor = resizedBitmap.GetPixel(x, y);

                            if (pixelColor.A == 0)
                            {
                                bitmap.SetPixel(x, y, SapColors.SapTransparent);
                            }
                        }
                    }

                    string tempFilePath = Path.Combine(Path.GetTempPath(), Guid.NewGuid().ToString() + ".bmp");

                    resizedBitmap.Save(tempFilePath, ImageFormat.Bmp);
                    
                    return tempFilePath;
                }
            }
        }

        private const string HitchIconData =
            "";
    }
}